INSERT INTO `v1_18bddc4773c37222e06796c9db963dab144e166c3dddc7c221064832a4a79a88` VALUES (0, 1070501, 4, "ふむ、よい趣向ですね。\n敬うべき相手を忘れず、恩を忘れず、\n健勝を祝う宴を開く……\n礼節を弁えた人間は好きですよ。", 1, 11, 1070501040, "", 107011, 0, 1);
