INSERT INTO `v1_18bddc4773c37222e06796c9db963dab144e166c3dddc7c221064832a4a79a88` VALUES (0, 1110501, 4, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 1, 11, 1110501046, "", 111011, 0, 1);
