INSERT INTO `v1_18bddc4773c37222e06796c9db963dab144e166c3dddc7c221064832a4a79a88` VALUES (0, 1110501, 5, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 1, 11, 1110501049, "", 111011, 0, 1);
