INSERT INTO `v1_18bddc4773c37222e06796c9db963dab144e166c3dddc7c221064832a4a79a88` VALUES (0, 1110501, 5, "是非もなし。\n端的に言えば、先輩ちょっと感激した。\n今宵は飲めや食えやの大騒ぎだ。\n朝まで踊り明かすぜ同志、ヒャッハー！", 1, 11, 1110501052, "", 111011, 0, 1);
